import React, { useState } from 'react';
import { Container, Typography, Box, TextField, Button, Paper } from '@mui/material';
import ModelSelection from './ModelSelection';
import PredictionResult from './PredictionResult';

const ManualInput = () => {
  const [experiences, setExperiences] = useState([{
    company: '',
    position: '',
    startDate: '',
    endDate: ''
  }]);
  const [selectedModel, setSelectedModel] = useState('');
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [validationErrors, setValidationErrors] = useState({});

  const handleAddExperience = () => {
    setExperiences([...experiences, {
      company: '',
      position: '',
      startDate: '',
      endDate: ''
    }]);
  };

  const handleRemoveExperience = (index) => {
    const newExperiences = experiences.filter((_, i) => i !== index);
    setExperiences(newExperiences);
  };

  const handleExperienceChange = (index, field, value) => {
    const newExperiences = [...experiences];
    newExperiences[index] = {
      ...newExperiences[index],
      [field]: value
    };
    setExperiences(newExperiences);

    // Reset validation error for this field
    if (validationErrors[`${index}-${field}`]) {
      const newValidationErrors = { ...validationErrors };
      delete newValidationErrors[`${index}-${field}`];
      setValidationErrors(newValidationErrors);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validation
    const newValidationErrors = {};
    let isValid = true;

    experiences.forEach((exp, index) => {
      if (!exp.company) {
        newValidationErrors[`${index}-company`] = true;
        isValid = false;
      }
      if (!exp.position) {
        newValidationErrors[`${index}-position`] = true;
        isValid = false;
      }
      if (!exp.startDate) {
        newValidationErrors[`${index}-startDate`] = true;
        isValid = false;
      }
    });

    if (!selectedModel) {
      setError('Bitte wählen Sie ein Modell aus');
      isValid = false;
    }

    if (!isValid) {
      setValidationErrors(newValidationErrors);
      return;
    }

    setLoading(true);
    setError('');

    try {
      const response = await fetch('/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          experiences,
          modelType: selectedModel,
        }),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.error || 'Ein Fehler ist aufgetreten');
      }

      setPrediction(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="md" sx={{ py: 4 }}>
      <Box className="header-section">
        <Box className="settings-header">
          <Typography variant="h1" gutterBottom>
            Karriere-Prognose
          </Typography>
          <Box className="settings-info">
            <Typography variant="body1" className="info-description">
              Analysieren Sie die Wechselwahrscheinlichkeit eines einzelnen Kandidaten basierend auf dessen Berufserfahrung.
            </Typography>
          </Box>
        </Box>
      </Box>

      <Box component="form" onSubmit={handleSubmit} className="pers-form">
        <Paper elevation={0} className="form-group" sx={{ mb: 3, p: 4 }}>
          <Typography variant="h6" gutterBottom>
            Berufserfahrung
          </Typography>

          <Box id="experiences" className="experiences-container">
            {experiences.map((exp, index) => (
              <Box 
                key={index}
                sx={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(4, 1fr)',
                  gap: 2,
                  mb: 3
                }}
              >
                <TextField
                  error={validationErrors[`${index}-company`]}
                  value={exp.company}
                  onChange={(e) => handleExperienceChange(index, 'company', e.target.value)}
                  placeholder="Firma"
                  fullWidth
                />
                <TextField
                  error={validationErrors[`${index}-position`]}
                  value={exp.position}
                  onChange={(e) => handleExperienceChange(index, 'position', e.target.value)}
                  placeholder="Position"
                  fullWidth
                />
                <TextField
                  error={validationErrors[`${index}-startDate`]}
                  type="date"
                  value={exp.startDate}
                  onChange={(e) => handleExperienceChange(index, 'startDate', e.target.value)}
                  fullWidth
                  InputLabelProps={{ shrink: true }}
                />
                <TextField
                  type="date"
                  value={exp.endDate}
                  onChange={(e) => handleExperienceChange(index, 'endDate', e.target.value)}
                  fullWidth
                  InputLabelProps={{ shrink: true }}
                />
                {experiences.length > 1 && (
                  <Button
                    onClick={() => handleRemoveExperience(index)}
                    sx={{
                      gridColumn: '1 / -1',
                      width: '120px',
                      marginRight: 'auto',
                      bgcolor: '#f8f9fa',
                      color: '#666',
                      '&:hover': {
                        bgcolor: '#dc3545',
                        color: 'white'
                      }
                    }}
                  >
                    Entfernen
                  </Button>
                )}
              </Box>
            ))}
          </Box>

          <Button
            type="button"
            onClick={handleAddExperience}
            variant="contained"
            sx={{ 
              width: '40%',
              mt: 2
            }}
          >
            Weitere Position hinzufügen
          </Button>
        </Paper>

        <Paper elevation={0} className="form-group" sx={{ p: 4 }}>
          <Typography variant="h6" gutterBottom>
            KI-Modell
          </Typography>

          <ModelSelection
            selectedModel={selectedModel}
            onModelChange={setSelectedModel}
            error={error}
          />

          <Button
            type="submit"
            variant="contained"
            disabled={loading}
            sx={{ 
              width: '60%',
              mt: 3,
              display: 'block',
              mx: 'auto'
            }}
          >
            {loading ? 'Wird berechnet...' : 'Prognose erstellen'}
          </Button>
        </Paper>
      </Box>

      {prediction && (
        <PredictionResult 
          prediction={prediction}
          loading={loading}
        />
      )}
    </Container>
  );
};

export default ManualInput;
